import './App.scss';
import 'bootstrap/dist/css/bootstrap.min.css';

import Header from './Header/Header';
import Footer from './Footer/Footer';
import SignUp from './SignUp/SignUp';
import SignIn from './SignIn/SignIn';

function App() {

	return (
		<>
			<Header/>
			<div className='page-wrapper'>
				<SignIn />
				<SignUP />
			</div>
			<Footer />
		</>
	)
}

export default App;
